import { Component, OnInit } from '@angular/core';
import { FormsModule } from '@angular/forms';
import { IonicModule } from '@ionic/angular';

@Component({
  selector: 'app-home',
  templateUrl: './home.component.html',
  styleUrls: ['./home.component.scss'],
  standalone: true,
  imports: [IonicModule, FormsModule]
})
export class HomeComponent  implements OnInit {

  activeStatus = 'active'

  constructor() { }

  ngOnInit() {}

}
<div class="w-full text-3xl">
    <div class="w-[90%] mx-auto flex items-center justify-between pt-6">
      <ion-select aria-label="Active Status" [(ngModel)]="activeStatus" class="rounded-xl bg-transparent text-darkChocolate border-solid border-2 border-brightOrange" placeholder="Status">
        <ion-select-option selected value="active">Active</ion-select-option>
        <ion-select-option selected value="inactive">Inactive</ion-select-option>
      </ion-select>
      <ion-bbutton class="rounded-xl border-solid border-2 border-brightOrange text-darkChocolate text-sm">Taxi Intensity</ion-bbutton>
    </div>
</div>
